import React from 'react';
//import imagelogo from '../../imagelogo.png';
import DialogsCss from './Dialogs.module.css';

const Dialogs = () => {
    return (
        <section className={DialogsCss.section}>
            <article>
                Dmytro
            </article>
            <article>
                Vasylyna
            </article>
            <article>
                Ivan
            </article>
            <article>
                Slavko
            </article>
            <article>
                Petro
            </article>
        </section>
    );
}

export default Dialogs;
